import React, { Component } from 'react';
import NavBar from './components/NavBar';
import News from './components/News';
import { 
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

export default class App extends Component {
render() {
    return (
      <div>
        <Router>
        <NavBar/>
        <Routes>
          <Route exact path='/' element={<News key={'general'} category='general'/>}/>
          <Route exact path='/business' element={<News key={'business'} category='business'/>}/>
          <Route exact path='/health' element={<News key={''} category='Health'/>}/>
          <Route exact path='/entertainment' element={<News key={''} category='entertainment'/>}/>
          <Route exact path='/general' element={<News key={''} category='general'/>}/>
          <Route exact path='/science' element={<News key={''} category='science'/>}/>
          <Route exact path='/sports' element={<News key={''} category='sports'/>}/>
          <Route exact path='/technology' element={<News key={''} category='technology'/>}/>
        </Routes>
        </Router>
      </div>
    )
  }
}
